import React from 'react';
import './App.css';
import {Routes , Route} from 'react-router-dom';


let App = () => {
  return (
    <React.Fragment>
      <NavBar/>
      <Routes>
        <Route path={'/'}/>
      </Routes>
    </React.Fragment>
  );
}

export default App;
